const HeroBanner = () => {

  const HeroBannerItem = () => {
    const bannerItem = [
      {
        image: '',
        title: '',
        desc: ''
      },
      {
        image: '',
        title: '',
        desc: ''
      },
    ]
  }
  return (
    // hero banner
    <div className="hero-banner">
      {}
      <div className="hero-banner__item">
        <div className="container">
          <div className="hero-banner__wrapper">
            <div className="hero-banner__img">
              <img className="hero-banner__img__el" src="assets/img/dummy/home-banner-1.png" alt="Virtual healthcare for you" />
            </div>
            <div className="hero-banner__txt">
              <div className="hero-banner__txt__align">
                <h2 className="hero-banner__title">{title}</h2>
                <p className="hero-banner__desc">{desc}</p>
                <div className="hero-banner__btn">
                  <a className="btn btn--primary" href="apps.html">Consult today</a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default HeroBanner;
